import React, { Component } from 'react';
import UrlService from '../services/UrlService';

export default class ViewUrlComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      short: this.props.short,
      full: ''
    };
  }

  componentDidMount() {
    UrlService.getUrlByPathId(this.state.short).then(res => {
      this.setState({ full: res.data.full });
    });
  }

  render() {
    return (
      <div>
        <br></br>
        <div className='card col-md-6 offset-md-3'>
          <h3 className='text-center'> View URL Details</h3>
          <div className='card-body'>
            <div className='row'>
              <label> Full Url: </label>
              <div> {this.state.full}</div>
            </div>
            <div className='row'>
              <label> Short Url: </label>
              <div> {this.state.short}</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
